import React, { useState } from "react";
import LabelStyle1 from "../components/custom controls/labels/LabelStyle1"
import TextBoxStyle2 from "../components/custom controls/textBox/TextBoxStyle2";
import ButtonStyle1 from "../components/custom controls/buttons/ButtonStyle1"
import ComboBoxStyle1 from "./custom controls/combo box/ComboBoxStyle1";
import GoogleIcon from "../Images/GoogleIcon.png"
import Login_SingUp_bg from "../Images/Login_SingUp_bg.png"

export default function SingUp(){
    const SingUpButtonHandled =()=> {
        alert("wsh moooooh!");
    }

    const facultyOptions = [
        { value: 'option1', label: 'Informatique' },
        { value: 'option2', label: 'Math' },
        { value: 'option3', label: 'Physique' },
    ];

    const specialityOptions = [
        { value: 'option1', label: 'Isil' },
        { value: 'option2', label: 'Si' },
    ];


    const academicYear = [
        {value:'option1', label:'Licence 1'},
        {value:'option2', label:'Licence 2'},
        {value:'option3', label:'Licence 3'},
        {value:'option4', label:'Master 1'},
        {value:'option5', label:'Master 2'},
    ]

    const [selectedValue, setSelectedValue] = useState(''); // الحالة لحفظ القيمة المختارة
    
    const handleSelectChange = (event) => {
        setSelectedValue(event.target.value); // تحديث القيمة بناءً على اختيار المستخدم
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setSingUpFormData((prevData) => ({
            ...prevData,
            [name]: value
        }));
    };

    const [loginFormData,setSingUpFormData] = useState({
        email:'',
        password:''
    });
    return(

        
            <div className="flex flex-col items-center w-full h-full">
                        <LabelStyle1 labelText="Sing up" labelClassName="mt-10 text-3xl justify-self-center mb-10"/>
                        <form className="flex flex-col w-[90%] h-full">
                            <div>
                    <div className="flex space-x-1 items-center mt-3 mb-3">
                <LabelStyle1 labelText="First Name :" labelClassName="text-sm whitespace-nowrap"/>
                <TextBoxStyle2 Name='firstname' placeholder="first name" value={loginFormData.firstname} onChange={handleChange} textBoxClassName="w-full"/>
                <LabelStyle1 labelText="Last Name :" labelClassName="text-sm whitespace-nowrap"/>
                <TextBoxStyle2 Name='lastname' placeholder="last name" value={loginFormData.lastname} onChange={handleChange} textBoxClassName="w-full"/>
                    </div>

                    <div className="flex space-x-1 items-center mt-3 mb-3">
                <LabelStyle1 labelText="matricule:" labelClassName="text-sm whitespace-nowrap"/>
                <TextBoxStyle2 Name='firstname' placeholder="222231354689" value={loginFormData.firstname} onChange={handleChange} textBoxClassName="w-full"/>
                <LabelStyle1 labelText="Faculty:" labelClassName="text-sm whitespace-nowrap"/>
                <ComboBoxStyle1 Name="myComboBox" options={facultyOptions} value={selectedValue} onChange={handleSelectChange} comboBoxClassName="w-32"/>
                    </div>
                    <div className="flex space-x-1 items-center mt-3 mb-3 w-[90%]">
                <LabelStyle1 labelText="Academic year" labelClassName="text-sm whitespace-nowrap"/>
                <ComboBoxStyle1 Name="myComboBox" options={academicYear} value={selectedValue} onChange={handleSelectChange} />
                <LabelStyle1 labelText="speciality" labelClassName="text-sm whitespace-nowrap"/>
                <ComboBoxStyle1 Name="myComboBox" options={specialityOptions} value={selectedValue} onChange={handleSelectChange} />
                    </div>
                    <div className="flex space-x-2 w-full bg-red-300">
                <LabelStyle1 labelText="Email:" labelClassName="text-md m-auto"/>
                <TextBoxStyle2 Name='email' textBoxtype='email' placeholder="Example@gmail.com" value={loginFormData.email} onChange={handleChange} textBoxClassName="w-76"/>
                    </div>
                    
                <div className="flex space-x-1 items-center mt-3 mb-3">
                <LabelStyle1 labelText="Password:" labelClassName="text-sm whitespace-nowrap"/>
                <TextBoxStyle2 Name='firstname' placeholder="password" value={loginFormData.firstname} onChange={handleChange} textBoxClassName="w-full"/>
                <LabelStyle1 labelText="Conferm password:" labelClassName="text-sm whitespace-nowrap"/>
                <TextBoxStyle2 Name='d' placeholder="password" value={loginFormData.lastname} onChange={handleChange} textBoxClassName="w-full"/>
                    </div>                
                    </div>
                    <div className="mt-auto mb-5">
                    <ButtonStyle1 buttonText="Sing-UP" buttonClassName="items-center w-full" onClick={SingUpButtonHandled}/>
                    <p className="text-gray-400 text-xs mt-3">you have Account? <a href="#" className="text-blue-400">Sing in</a></p>
                    </div>
                
                </form>
                
            </div>
    );

}
